export const DescriptionEl = (userInfo) => {
  return (
    <div>
      <img src= {userInfo.avatar}alt="User avatar" />
      <p>{userInfo.username}</p>
      <p>{userInfo.tag}</p>
      <p>{userInfo.location}</p>
    </div>
  );
};
